import React, { Component } from 'react';
import Tabletop from 'tabletop';
import { Table } from 'reactstrap';

class Namelist extends Component {
    constructor() {
        super()
        this.state = {
            data: []
        }
    }

    componentDidMount() {
        Tabletop.init({
            key: '1lTvlri1R_Jjt6_YnhvwnDxYCnNXJHHXaJxEOqETOwi0',
            callback: googleData => {
                this.setState({
                    data: googleData
                })

            },
            simpleSheet: true
        })
    }

    render() {
        const { data } = this.state
        return (
            <div>
                <Table>
                    <thead>
                        <tr>
                            <th>จังหวัด</th>
                            <th>อำเภอ</th>
                            <th>อปท.</th>
                            <th>60-69 ปี</th>
                            <th>70-79 ปี</th>
                            <th>80-89 ปี</th>
                            <th>รวม</th>
                            <th>จำนวนเงินทั้งสิ้น</th>
                        </tr>
                    </thead>

                    {data.map(obj => (    
                    <tbody>
                        <tr>
                            <th scope="row">{obj.จังหวัด}</th>
                            <td>{obj.อำเภอ}</td>
                            <td>{obj.อปท}</td>
                            <td>{obj.อายุ60ถึง69ปี}</td>
                        </tr>
                        
                    </tbody>
                    ))}
                </Table>

            </div>
        )
    }
}

export default Namelist








